import './App.css';
import ChatBot from './ChatBot';
import Header from './Header';
import Home from './Home';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Menu from './Menu';
import FormsList from './FormsList';
import React from 'react';
// import OCR from './OCR';

function App() {
  return (
    <div>
      {/* <OCR/> */}
      <Router>
        {/* <Header /> */}
        <Routes>
          {/* <Route exact path='/ocr' Component={OCR} /> */}
          <Route exact path='/formsList' element={<React.Fragment>
              <Header/>
              <FormsList/>
            </React.Fragment>}> 
          </Route>
          <Route exact path='/menu' element={<React.Fragment>
              <Header/>
              <M/>
            </React.Fragment>}> 
          </Route>
          <Route exact path='/chatBot' element={<React.Fragment>
              <Header/>
              <FormsList/>
            </React.Fragment>}> 
          </Route>
          <Route exact path='/' element={<React.Fragment>
              <Header/>
              <FormsList/>
            </React.Fragment>}> 
          </Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
